  "notes": "* <i>Trample</i> deals <span data-tip=\"Persistent area damage\" class=\"glossary\" data-game=\"lol\" style=\"white-space:pre; position:relative;\"><a title=\"Damage\" href=\"/wiki/Damage\"><img alt=\"Poison Trail\" loading=\"lazy\" data-image-name=\"Singed Poison Trail.png\" data-image-key=\"Singed_Poison_Trail.png\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/3/39/Singed_Poison_Trail.png/revision/latest/scale-to-width-down/20?cb=20141023220615\" width=\"20\" data-relevant=\"0\" class=\"lazyload\" src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" decoding=\"async\" height=\"20\"></a> <a href=\"/wiki/Damage\" title=\"Damage\">persistent area damage</a></span> damage around <b>Alistar</b>, while the bonus damage on the resulting attack is <span style=\"white-space:pre; position:relative;\" class=\"glossary\" data-game=\"lol\" data-tip=\"Proc damage\"><a href=\"/wiki/Damage\" title=\"Damage\"><img data-image-key=\"Wit%27s_End_item.png\" data-relevant=\"0\" height=\"20\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/1/16/Wit%27s_End_item.png/revision/latest/scale-to-width-down/20?cb=20201027220422\" decoding=\"async\" class=\"lazyload\" loading=\"lazy\" data-image-name=\"Wit's End item.png\" alt=\"Wit's End item\" src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" width=\"20\"></a> <a href=\"/wiki/Damage\" title=\"Damage\">proc damage</a></span>.\n<ul><li>The <span style=\"white-space:pre; position:relative;\" class=\"glossary\" data-game=\"lol\" data-tip=\"Stun\"><a href=\"/wiki/Stun\" title=\"Stun\"><img decoding=\"async\" class=\"lazyload\" data-image-name=\"Stun icon.png\" data-image-key=\"Stun_icon.png\" data-relevant=\"0\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/9/9d/Stun_icon.png/revision/latest/scale-to-width-down/20?cb=20171201223940\" height=\"20\" alt=\"Stun icon\" src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" loading=\"lazy\" width=\"20\"></a> <a class=\"mw-redirect\" href=\"/wiki/Stun\" title=\"Stun\">stun</a></span> and <b>bonus</b> damage are blocked by <span class=\"glossary\" data-game=\"lol\" data-tip=\"Spell shield\" style=\"white-space:pre; position:relative;\"><a title=\"Spell shield\" href=\"/wiki/Spell_shield\"><img decoding=\"async\" height=\"20\" width=\"20\" class=\"lazyload\" loading=\"lazy\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/a/a0/Sivir_Spell_Shield.png/revision/latest/scale-to-width-down/20?cb=20170818194532\" data-image-name=\"Sivir Spell Shield.png\" data-image-key=\"Sivir_Spell_Shield.png\" src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" data-relevant=\"0\" alt=\"Spell Shield\"></a> <a href=\"/wiki/Spell_shield\" title=\"Spell shield\">spell shields</a></span> but the base attack damage is not.</li>\n<li>The on-hit effect is consumed if the attack <span class=\"glossary\" data-game=\"lol\" data-tip=\"Blocked\" style=\"white-space:pre; position:relative;\"><a href=\"/wiki/Attack_effects#Parrying\" title=\"Attack effects\"><img decoding=\"async\" height=\"20\" data-image-name=\"Shen Spirit's Refuge.png\" alt=\"Spirit's Refuge\" data-image-key=\"Shen_Spirit%27s_Refuge.png\" data-relevant=\"0\" width=\"20\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/0/0a/Shen_Spirit%27s_Refuge.png/revision/latest/scale-to-width-down/20?cb=20170217191016\" class=\"lazyload\" src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" loading=\"lazy\"></a> <a href=\"/wiki/Attack_effects#Parrying\" title=\"Attack effects\">blocked</a></span>, but not if it is <span data-tip=\"Dodged\" class=\"glossary\" style=\"white-space:pre; position:relative;\" data-game=\"lol\"><a href=\"/wiki/Attack_effects#Parrying\" title=\"Attack effects\"><img decoding=\"async\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/6/62/Jax_Counter_Strike_old.png/revision/latest/scale-to-width-down/20?cb=20171223030746\" alt=\"Jax Counter Strike old\" src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" data-image-key=\"Jax_Counter_Strike_old.png\" loading=\"lazy\" data-relevant=\"0\" class=\"lazyload\" data-image-name=\"Jax Counter Strike old.png\" height=\"20\" width=\"20\"></a> <a title=\"Attack effects\" href=\"/wiki/Attack_effects#Parrying\">dodged</a></span> or missed while <b>Alistar</b> is <span style=\"white-space:pre; position:relative;\" class=\"glossary\" data-game=\"lol\" data-tip=\"Blind\"><a title=\"Blind\" href=\"/wiki/Blind\"><img data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/8/81/Blind_icon.png/revision/latest/scale-to-width-down/20?cb=20171201224954\" width=\"20\" src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" alt=\"Blind icon\" class=\"lazyload\" data-relevant=\"0\" loading=\"lazy\" data-image-name=\"Blind icon.png\" decoding=\"async\" height=\"20\" data-image-key=\"Blind_icon.png\"></a> <a title=\"Blind\" href=\"/wiki/Blind\" class=\"mw-redirect\">blinded</a></span>. In all cases, the attack's effects are negated as normal.</li>\n<li>As it is an <a title=\"On-hit\" href=\"/wiki/On-hit\" class=\"mw-redirect\">on-hit</a> effect, the bonus damage and stun can be applied by <span data-item=\"Guinsoo's Rageblade\" class=\"inline-image label-after item-icon\" data-game=\"lol\" style=\"display:inline;white-space:pre;\" data-param=\"\"><span style=\"display:inline-block;position:relative;\" data-width=\"20\" class=\"border\"><a href=\"/wiki/Guinsoo%27s_Rageblade\" title=\"Guinsoo's Rageblade's\"><img src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" loading=\"lazy\" width=\"20\" height=\"20\" class=\"thumbborder lazyload\" decoding=\"async\" data-image-name=\"Guinsoo's Rageblade item.png\" data-image-key=\"Guinsoo%27s_Rageblade_item.png\" data-relevant=\"0\" alt=\"Guinsoo's Rageblade's\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/9/95/Guinsoo%27s_Rageblade_item.png/revision/latest/scale-to-width-down/20?cb=20201029192542\"></a></span> <span style=\"white-space:normal;\"><a href=\"/wiki/Guinsoo%27s_Rageblade\" title=\"Guinsoo's Rageblade\">Guinsoo's Rageblade's</a></span></span> Phantom Hit.</li></ul>",
